import { createAsyncThunk, createSlice } from '@reduxjs/toolkit';
import {codeCompletion, uploadCode} from '../services/review.service';

const initialState = {
    createdUploads: ['was geht']
};

export const codeCompletionAsync = createAsyncThunk(
    'review/codeCompletion',
    async (data) => {
        const response = await codeCompletion(data);
        return response.data;
    }
);

export const uploadCodeAsync = createAsyncThunk(
    'review/uploadCode',
    async (data) => {
        const response = await uploadCode(data);
        return response.data;
    }
);

export const reviewSlice = createSlice({
    name: 'review',
    initialState,
    reducers: {
    },
    extraReducers: (builder) => {
        builder
            .addCase(codeCompletionAsync.fulfilled, (state, action) => {
                //todo add to redux
            })
            .addCase(uploadCodeAsync.fulfilled, (state, action) => {
                //todo add to redux
            })
    },
});

export const {} = reviewSlice.actions;

export const selectCreatedUploads = (state) => state.review.createdUploads;

export default reviewSlice.reducer;
